import React, {Component} from 'react';
import AppNav from "./AppNav";
import { Container, Row, Col} from 'reactstrap';
import bgimage01 from './assets/bg-image01.png';
import profilepic from './assets/profile-pic.png';
import profilepic3 from './assets/profile-pic03.png';
import Linkedin1 from './assets/Linkedin01.png';
import Facebook1 from './assets/facebook01.png';
import Github1 from './assets/GitHub01.png';

import Image from 'react-bootstrap/Image';
import './Home.css';


class Home extends Component {

    render() { 
        return (
                    <div class="divStyle" fluid>
                    <Container>
                    <div class="divAppNav">
                    <AppNav />
                    </div>
                    <div class="divProfileImage">
                        <Image src={profilepic3} roundedCircle fluid></Image><br/>
                        <h1>Ankit Lalwani</h1><br/>
                        <div class="divOtherImage">
                        <a class="divOtherImage" href="/"><img src={Linkedin1} roundedCircle fluid onClick="/" ></img></a>
                        <Image src={Facebook1} roundedCircle fluid ></Image>
                        <Image src={Github1} roundedCircle fluid ></Image>
                        </div>
                    </div>
                    </Container>
            </div>

         );
    }
}

export default Home;
